INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('0043647630025', 'Christmas Pudding', 'RAISINS 27% (SULTANAS 1 1%, CORINTHE 1 1%, RAISINS 5%), SUCRE, CHAPELURE (CONTIENT DU BLE), HUILE DE PALME RAFFINEE, CIDRE, FARINE DE BLE, OEUFS, ZESTES DE CITRON, MARMELADE D\'ORANGE, COGNAC, MÉLANGE D\'ÉPICES, SEL. CE PUDDING EST DEJA CUIT ET NE DEMANDE QU\'A ETRE RECHAUFFE. ENLEVER LA CELLOPHANE ET PLACER AU BAIN MARIE PENDANT 1 HI/2. EVITEZ QUE L\'EAU NE PENETRE PAS DANS LE PUDDING. AVANT DE SERVIR DEMOULEZ, SAUPOUDREZ DE SUCRE, ARROSEZ DE COGNAC ET FLAMBEZ. &quot;TIPTREE&quot; CHRISTMAS PUDDING ZUTATEN: GETROCKNETE WEINTRAUBEN 27% (SULTANINEN 1 1%, KORINTHEN 1 1%, ROSINEN 5%) ZUCKER, SEMMELBRÒSEL (ENTHALTEN WEIZEN), RAFFINIERTES PALMÔL, APFËLWEIN, WEIZENMEHL, EIER, ZITRUSSCHALEN, &quot;TAWNY&quot; ORANGEN MARMELADE, WEINBRAND, GEWÜRZE, SALZ. DIESER CHRISTMAS PUDDING IST BEREITS GEKOCHT. BITTE ENTFERNEN SIE DAS ZELLOPHAN UND ERHITZEN DEN CHRISTMAS PUDDING FÜR 90 MINUTEN IM WASSERBAD. DAS TUCH SOLL DABEI DEN PUDDING ABDECKEN, DAMIT KEIN WASSER IN DEN PUDDING KOMMT. DAZU REICHT MAN WARME VANILLESAUCE. BELIEBT IST AUCH DEN PUDDING MIT BRANDY BUTTER ZU BESTREICHEN UND MIT BRANDY ODER KIRSCHWASSER ZU FLAMBIEREN.', 'https://static.openfoodfacts.org/images/products/004/364/763/0025/front_fr.8.400.jpg', '5.3', '2.14', '59', '28', '1.3', '3.6', '0.1', '0.0393700787401575', '', '0');

